[mod-setting-description]
rampant-unitSpawnerBreath=Now unit spawners breath air so they are affected by things like poison capsules
rampant-useDumbProjectiles=Use the projectile attacks that are blockable. This should be checked if you are using the new enemies.
rampant-attackWaveGenerationUsePlayerProximity=Include player pheromones amount for threshold on chunks with biter nests that will generate a Rampant attack wave. DOES NOT affect vanilla biters waves
rampant-attackWaveGenerationThresholdMax=The total score that a chunk must reach in order for an attack wave to spawn. DOES NOT affect vanilla biters waves. Scaling linearly with evolution factor (starting threshold @ 0.0 evolution)
rampant-attackWaveGenerationThresholdMin=The total score that a chunk must reach in order for an attack wave to spawn. DOES NOT affect vanilla biters waves. Scaling linearly with evolution factor (ending threshold @ 100.0 evolution)
rampant-attackWaveMaxSize=If you wish to change how the attack wave scales with evolution you will need to modify the config.lua in the zip file.
rampant-safeBuildings=This needs to be toggle for the safe building toggles to work. This will cause entities made safe to regenerate with the destructible flag set to false, which causes them to never be targeted or damaged again.
rampant-safeBuildings-curvedRail=Make curved rails safe from biters
rampant-safeBuildings-straightRail=Make straight rails safe from biters
rampant-safeBuildings-bigElectricPole=Make big electric poles safe from biters
rampant-safeBuildings-railChainSignals=Make rail chain signals safe from biters
rampant-safeBuildings-railSignals=Make rail signals safe from biters
rampant-safeBuildings-lamps=Make lamps safe from biters
rampant-safeBuildings-trainStops=Make train stops safe from biters
rampant-attackPlayerThreshold=The score that a chunk must reach for it to contribute to the attack threshold. Increasing reduces player pheromone cloud impact.
rampant-permanentNocturnal=Toggling this will cause Rampant attack waves to spawn at night. DOES NOT turn off vanilla attack groups yet. Works better with Day/Night extender mod.
rampant-aiPointsScaler=Between 0.0 and 5.0. This scales how many action points the ai gets per logic cycle to perform actions like making attack waves. 0.3 - very easy, 0.75 - easy, 1.0 - medium, 1.25+ - hard
rampant-addWallResistanceAcid=Toggling this will cause a %60 acid resistance to be added to all wall entities to reduce the damage done by spitters to walls back to vanilla levels.
rampant-removeBloodParticles=The blood particles that are created when biters are being killed can cause UPS spikes, this removes them.
rampant-enableSwarm=This reduces the size of the unit collision_mask causing them to reduce pathing collisions and smooth out the attacks
rampant-attack-warning=Shows a message warning players that an attack wave is incoming
rampant-newEnemies=Adds news enemies that will be dispersed over the world. This increases the RAM requirements. With 1 variation for each biter, worm, and nest and 5 tiers expect upto a 2GB RAM increase. With 20 variations and 10 tiers set expect up to 9GB RAM increase. Variations add randominess to each tier of biter, worms, or nests. Tiers are the power level of the biters.
rampant-enemySeed=The seed that powers all of the unit generation, so change this if you want the enemy stats to change
rampant-deadZoneFrequency=The percentage of zones that start without worms or nests
rampant-newEnemyNestVariations=This number corresponds to the number of variations per tier. This adds randominess to each tier. Min 1, Max 20
rampant-newEnemyNestTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve. Enemy level for the tiers start at the enemy level and increase linearly till the end level. The default tier of 5 with enemy levels 1-4 will create the set (1,2,3,3,4). See enemy levels for rough health approximation of each level.
rampant-newEnemyWormVariations=This number corresponds to the number of variations per tier. This adds randominess to each tier. Min 1, Max 20
rampant-newEnemyWormTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve. Enemy level for the tiers start at the enemy level and increase linearly till the end level. The default tier of 5 with enemy levels 1-4 will create the set (1,2,3,3,4). See enemy levels for rough health approximation of each level.
rampant-newEnemyUnitVariations=This number corresponds to the number of variations per tier. This adds randominess to each tier. Min 1, Max 20
rampant-newEnemyUnitTiers=This number corresponds to number of tiers. The higher the number the smoother the enemy power curve. Enemy level for the tiers start at the enemy level and increase linearly till the end level. The default tier of 5 with enemy levels 1-4 will create the set (1,2,3,3,4). See enemy levels for rough health approximation of each level. This is recommended to be 10.
rampant-enableBobsUnits=Adds bobs spawners, units, and worms to the base upgrade and placement list
rampant-enableNEUnits=Adds NE spawners, units, and worms to the base upgrade and placement list
rampant-disallowFriendlyFire=Prevents enemy spitters and worms from damaging units or buildings from the same force through splash damage
rampant-tierStart=This is the starting level of the enemy that will be used when generating the set of enemies for the specified number of tiers and increases linearly to the end tier for as many tiers selected. Roughly healthwise each tier is a follows (1-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000). min 1, max 10
rampant-tierEnd=This is the ending tier level that is reached after increasing linearly from the start tier for as many tiers selected. Roughly healthwise each tier is a follows (1-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000). min 1, max 10
rampant-disableVanillaAI=This will turn off the vanilla attack waves and the vanilla biter expansion.
rampant-enableMigration=This will allow the ai to expand its worms and nests. Respects the map settings for biter expansion.

rampant-enableShrinkNestsAndWorms=Reduce the collision box size of nests and worms by 50%. May cause overlapping entities due to the collision box being smaller than the entity graphic.

rampant-unkillableLogisticRobots=This will make logistic bots immune to all damage
rampant-unkillableConstructionRobots=This will make construction bots immune to all damage

rampant-aiAggressiveness=This setting directly affects how often the ai enters a peaceful state. Less than one will cause biters to be more aggressive, greater than one the biters will be more peaceful. Settings this to zero will cause the AI to never be at peace. 0 - 2

rampant-unitBiterHealthScaler=Scales by a percentage all new enemy biter health
rampant-unitBiterSpeedScaler=Scales by a percentage all new enemy biter speed
rampant-unitBiterDamageScaler=Scales by a percentage all new enemy biter damage
rampant-unitBiterRangeScaler=Scales by a percentage all new enemy biter attack range
rampant-unitSpitterHealthScaler=Scales by a percentage all new enemy spitter health
rampant-unitSpitterSpeedScaler=Scales by a percentage all new enemy spitter speed
rampant-unitSpitterDamageScaler=Scales by a percentage all new enemy spitter damage
rampant-unitSpitterRangeScaler=Scales by a percentage all new enemy spitter range
rampant-unitDroneHealthScaler=Scales by a percentage all new enemy drone health. Drones come from the factions spawner and wasp.
rampant-unitDroneSpeedScaler=Scales by a percentage all new enemy drone speed. Drones come from the factions spawner and wasp.
rampant-unitDroneDamageScaler=Scales by a percentage all new enemy drone damage. Drones come from the factions spawner and wasp.
rampant-unitDroneRangeScaler=Scales by a percentage all new enemy drone range. Drones come from the factions spawner and wasp.
rampant-unitWormHealthScaler=Scales by a percentage all new enemy worm health
rampant-unitWormDamageScaler=Scales by a percentage all new enemy worm damage
rampant-unitWormRangeScaler=Scales by a percentage all new enemy worm range
rampant-unitSpawnerHealthScaler=Scales by a percentage all new enemy nest health
rampant-unitSpawnerOwnedScaler=Scales by a percentage all new enemy nest max number of units controlled per spawner
rampant-unitSpawnerSpawnScaler=Scales by a percentage all new enemy nest number of units spawned at any one time
rampant-unitSpawnerRespawnScaler=Scales by a percentage all new enemy nest time to spawn new units

rampant-raidAIToggle=Toggles the ai raiding parties from outside your pollution cloud
rampant-siegeAIToggle=Toggles the ai siege parties from outside your pollution cloud that attack or nest
rampant-onslaughtAIToggle=Toggles the ai onslaught state where the AI gets 2x credits per logic cycle

rampant-laserEnemy=Laser Biter Faction, Laser is major resistance, electric is a minor resistance. Has Biters and Spitter unit types.
rampant-waspEnemy=Wasp Biter Faction, Spitter only units and each spitter spits small drones.
rampant-spawnerEnemy=Spawner Biter Faction, Only Spitters produced by spawners and spitters make eggs that hatch into biters.
rampant-trollEnemy=Troll Biter Faction, High health regeneration, major weakness to fire, minor resistance to physical, minor resistance to explosive.
rampant-fastEnemy=Fast Biter Faction, High rate of movement, minor resistance to explosive.
rampant-infernoEnemy=Inferno Biter Faction, Only Spitters that spit flaming acid that burns everything. Major resistance to Acid & Fire, Minor weakness to poison.
rampant-nuclearEnemy=Nuclear Biter Faction, Only Biters that explode like a atomic bomb. Major weakness to explosive.
rampant-electricEnemy=Electric Biter Faction, Only Biters with a short range attack that hits multiple entities in a line. Major resistance to Electric, Minor resistance to Laser.
rampant-fireEnemy=Fire Biter Faction, Major resistance to Acid & Fire.
rampant-suicideEnemy=Suicide Biter Faction, Only Biters that explode when they attack. Minor resistance to Poison, Major weakness to explosive.
rampant-physicalEnemy=Physical Biter Faction, Only Biters. Major resistance to physical, Major resistance to explosive, Minor Weakness to Electric.
rampant-acidEnemy=Acid Biter Faction, Major resistance to Acid, Minor resistance to Poison.
rampant-energyThiefEnemy=Energy Thief Biter Faction, Major resistance to Electric, Minor resistance to Laser. Destroying powered structures creates draining crystals.
rampant-poisonEnemy=Poison Biter Faction, Only Biters. On death creates a cloud that heals biters and hurts player objects. Major resistance to Poison, Minor weakness to Electric, Minor weakness to Explosive, Minor weakness to Laser, Minor resistance to Fire.

rampant-disableCollidingProjectiles=Biter projectiles no longer collide with other biters, worms or nests. Everything else still collides with biter projectiles.
rampant-liteMode=AI is still fully functional but the map scanning and processing is slowed, which will cause pheromones to remain longer, reduce the number of attacks spawned, and pheromones will spread slower.
rampant-enableFullMapScan=This setting causes the game map to slowly be scanned for entities created or destroyed outside of the factorio event system. (If a mod isn't using script_raised_built or script_raised_destroyed this will cause Rampant to still eventually be consistent with the game map)